description: "A coprophilic fungi At this time of the year macrofungi are scarce. These appeared to be growing from roo scats. Approxiamtely 60mm tall. Wiry stipes matte finish on top and dry.  \r\ndark spores.. no sign of a ring... striated stipe just below the cap with a slight spiral?\r\nIn new grasses. open dry sclerophyll eucy forest in a local nature reserve. Police paddocks.\r\n\r\n\r\n"
